//import logo from './logo.svg';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom' ;
import 'bootstrap/dist/css/bootstrap.min.css' ;

import AddIncident from "./Components/AddIncident.component"
import RenderIncident from "./Components/RenderIncident.component"
import Result from "./Components/Result.component"

function App() {
  return (
    <Router>
      <div className="container">
        {/* 40% of the screen for AddIncident and RenderIncident */}
        <div className="components" style={{ width: '40%', float: 'left' }}>
          <AddIncident />
          <RenderIncident />
        </div>

        {/* 60% of the screen for mymap.html using iframe */}
        <div className="mymap" style={{ width: '60%', float: 'left' }}>
          <iframe
            title="mymap"
            src={"./src\mymap.html"} // Path to mymap.html in your public folder
            style={{ width: '100%', height: '100%' }}
            frameBorder="0"
          ></iframe>
        </div>
      </div>
    </Router>
  );
}

export default App;
